import React from "react";
import { useNavigate } from "react-router-dom";
// Import Swiper React components
import { Controller, Pagination } from 'swiper';
// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import { Swiper, SwiperSlide } from "swiper/react";
import dataM from '../data/gogungCategory.json';




function Main(){
    const http = dataM.http;
    const navigate = useNavigate();
    function navi(url){
        navigate(url);

    }
    return(
        <>
                <div className='slide-wrap' >
                    <Swiper
                        pagination={{
                        dynamicBullets: true,
                        }}
                        modules={[Pagination]}
                        className="mySwiper"
                        >
                        {dataM.gogung.map((v,k)=>(
                            <SwiperSlide key={k} onClick={()=>{navi(`/gung/${k}`)}}>
                                <div key={k}>
                                    <img src={v.imgUrl} alt={k} key={k}/>
                                    <p className="main-title" key={k}>아름다운 "<b key={k}>{v.gung_Name}</b>" 산책 가자!</p>
                                </div>
                            </SwiperSlide>
                        ))}
                    </Swiper>
                </div>
        </>
    );
}
export default Main;
